 INSERT INTO srdb.assessment VALUES('DFO-QUE-COD3Pn4RS-1964-2007-PREFONTAINE', 'DFO-QUE', 'COD3Pn4RS', 'PREFONTAINE', '2008-08-20', '2009-03-17 21:09:30', '1964-2007', 'http://www.dfo-mpo.gc.ca/csas/csas/Publications/Pub_Index_e.htm', 'contact details ', 'Two different models were included in the assessment and so there are two time series, one for each model, for some of the data. There was no available data for total landings of this stock. The age at 50% maturity was taken from Table 8: 3Pn 4RS Cod: Parameter estimates of the logistic model and mature proportion at age. In this table the 2007 datapoint is an average of years 2004-2006. The fecundity is not included in biometrics as it is found in the research document in Table 20: 3Pn 4RS Cod: Fecundity. Mortality is also not included in biometrics and can be found as a time series instead.', '', 1, 0, 'ADAPT', 'no comments', '../spreadsheets/PREFONTAINE-COD3Pn4RS-2007-editedDR.xls') ; 
